import Home from "./Home"
import YoutubeMain from "./youtube api/YoutubeMain"
import {BrowerRouter,Route,Switch} from "react-router-dom"
class App extends Component {
    render () {
    return <div>
    <BrowerRouter></BrowerRouter>
        <Home/>
        <YoutubeMain />
    </div>
    }
}

export default App
